import '../style/Header.scss'; 
import '../style/base.scss';
import { useEffect } from 'react'
export default function Header(props) {

    useEffect(() => {
        console.log(props.refCollection);
    })
    return (
        <div className="header">
            <span className='header__logo'>Vu Huy Bui</span>
            <div className='header__wrap'>
                <div className='header__navbar'>
                    <span onClick={props.listRef['home'].current} className='header__nav'>
                        Home
                    </span>
                    <span onClick={props.listRef['about'].current} className='header__nav'>
                        About
                    </span>
                    <span onClick={props.listRef['projects'].current} className='header__nav'>
                        Projects
                    </span>
                    <span className='header__nav'>Off-topic</span>
                    <span onClick={props.listRef['contact'].current.scrollIntoView(true)} className='header__nav contact-btn btn'>
                        Contact me

                    </span>
                </div>
            </div>
        </div>
    )
}
